pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @dev Interface of the ERC20 standard as defined in the EIP.
 */
interface ICertToken is IERC20 {

    function burn(address account, uint256 amount) external;

    function mint(address account, uint256 amount) external;

    function balanceWithRewardsOf(address account) external returns (uint256);

    function isRebasing() external returns (bool);

    function ratio() external view returns (uint256);

    function bondsToShares(uint256 amount) external view returns (uint256);
}

// SPDX-License-Identifier: GPL-3.0-only
pragma solidity ^0.8.10;

interface IBNBStakingPool {
    function stakeCerts() external payable;

    function unstakeCertsFor(address receiverAddress, uint256 shares) external;

    function getMinStake() external view returns (uint256);

    function getMinUnstake() external view returns (uint256);

    function getPendingUnstakesOf(address claimer) external view returns (uint256);
}

// SPDX-License-Identifier: GPL-3.0-only
pragma solidity ^0.8.10;

interface IBinancePool {
    function stakeAndClaimCerts() external payable;

    function unstakeCertsFor(address recipient, uint256 shares) external;

    function getMinimumStake() external view returns (uint256);

    function getRelayerFee() external view returns (uint256);

    function pendingUnstakesOf(address claimer) external view returns (uint256);
}

// SPDX-License-Identifier: GPL-3.0-only
pragma solidity ^0.8.0;

interface ICerosRouter {
    /**
     * Events
     */

    event Deposit(
        address indexed account,
        address indexed token,
        uint256 amount,
        uint256 profit
    );

    event Claim(
        address indexed recipient,
        address indexed token,
        uint256 amount
    );

    event Withdrawal(
        address indexed owner,
        address indexed recipient,
        address indexed token,
        uint256 amount
    );

    event ChangeVault(address vault);

    event ChangeDex(address dex);

    event ChangePool(address pool);

    event ChangeBNBStakingPool(address pool);

    event ChangeDao(address dao);

    event ChangeCeToken(address ceToken);

    event ChangeCeTokenJoin(address ceTokenJoin);

    event ChangeCertToken(address certToken);

    event ChangeCollateralToken(address collateralToken);

    event ChangeProvider(address provider);

    /**
     * Methods
     */

    /**
     * Deposit
     */

    // in BNB
    function deposit() external payable returns (uint256);

    // in aBNBc
    function depositABNBcFrom(address owner, uint256 amount)
    external
    returns (uint256);

    function depositABNBc(uint256 amount) external returns (uint256);

    /**
     * Claim
     */

    // claim in aBNBc
    function claim(address recipient) external returns (uint256);

    function claimProfit(address recipient) external;

    /**
     * Withdrawal
     */

    // BNB
    function withdraw(address recipient, uint256 amount)
    external
    returns (uint256);

    // BNB
    function withdrawFor(address recipient, uint256 amount)
    external
    returns (uint256);

    // BNB
    function withdrawWithSlippage(
        address recipient,
        uint256 amount,
        uint256 slippage
    ) external returns (uint256);

    // aBNBc
    function withdrawABNBc(address recipient, uint256 amount)
    external
    returns (uint256);

    function getProfitFor(address account) external view returns (uint256);
    function getYieldFor(address account) external view returns(uint256);
}

// SPDX-License-Identifier: GPL-3.0-only
pragma solidity >=0.8.2;

interface IDex {
    function factory() external pure returns (address);

    function WETH() external pure returns (address);

    function swapExactTokensForTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external returns (uint256[] memory amounts);

    function swapTokensForExactTokens(
        uint256 amountOut,
        uint256 amountInMax,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external returns (uint256[] memory amounts);

    function swapExactETHForTokens(
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external payable returns (uint256[] memory amounts);

    function swapExactTokensForETH(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external returns (uint256[] memory amounts);

    function quote(
        uint256 amountA,
        uint256 reserveA,
        uint256 reserveB
    ) external pure returns (uint256 amountB);

    function getAmountOut(
        uint256 amountIn,
        uint256 reserveIn,
        uint256 reserveOut
    ) external pure returns (uint256 amountOut);

    function getAmountIn(
        uint256 amountOut,
        uint256 reserveIn,
        uint256 reserveOut
    ) external pure returns (uint256 amountIn);

    function getAmountsOut(uint256 amountIn, address[] calldata path)
        external
        view
        returns (uint256[] memory amounts);

    function getAmountsIn(uint256 amountOut, address[] calldata path)
        external
        view
        returns (uint256[] memory amounts);
}

// SPDX-License-Identifier: GPL-3.0-only
pragma solidity ^0.8.6;
interface IVault {
    /**
     * Events
     */
    event Deposited(
        address indexed owner,
        address indexed recipient,
        uint256 value
    );
    event Claimed(
        address indexed owner,
        address indexed recipient,
        uint256 value
    );
    event Withdrawn(
        address indexed owner,
        address indexed recipient,
        uint256 value
    );
    event RouterChanged(address router);
    event CeTokenChanged(address oldToken, address newToken);
    /**
     * Methods
     */
    event RatioUpdated(uint256 currentRatio);
    function deposit(uint256 amount) external returns (uint256);
    function depositFor(address recipient, uint256 amount)
    external
    returns (uint256);
    function claimYields(address recipient) external returns (uint256);
    function claimYieldsFor(address owner, address recipient)
    external
    returns (uint256);
    function withdraw(address recipient, uint256 amount)
    external
    returns (uint256);
    function withdrawFor(
        address owner,
        address recipient,
        uint256 amount
    ) external returns (uint256);
    function getPrincipalOf(address account) external view returns (uint256);
    function getYieldFor(address account) external view returns (uint256);
    function getTotalAmountInVault() external view returns (uint256);
    function getCeTokenBalanceOf(address account) external view returns (uint256);
    function getDepositOf(address account) external view returns (uint256);
    function getClaimedOf(address account) external view returns (uint256);
}

